import Header from "../components/Header";
import "./css/Normalize.css"
import "./css/Home.css"
import { Button } from "@mui/material";

const Home = () => {
  return (
    <div>
      <body> 
        <Header/>
        <div class="jumbotron">
          <Button variant="outlined">Search</Button>
        </div>

        <footer>
          <p>&copy; 2022 CarGrab.com</p>
        </footer>
      </body>
    </div>
  );
};

export default Home;
